insert into books (title, author, category, establish, sold, avatar, description, totalpage, price, remain)
values ('Mắt biếc', 'Nguyễn Nhật Ánh', 'Tiểu thuyết', '1989-11-16', '293', 'data:image/webp;base64,', 'Mắt biếc là một tác phẩm được nhiều người bình chọn là hay nhất của nhà văn Nguyễn Nhật Ánh. Tác phẩm này cũng đã được dịch giả Kato Sakae dịch sang tiếng Nhật để giới thiệu với độc giả Nhật Bản. \n“Tôi gửi tình yêu cho mùa hè, nhưng mùa hè không giữ nổi. Mùa hè chỉ biết ra hoa, phượng đỏ sân trường và tiếng ve nỉ non trong lá. Mùa hè ngây ngô, giống như tôi vậy. Nó chẳng làm được những điều tôi ký thác. Nó để Hà Lan đốt tôi, đốt rụi. Trái tim tôi cháy thành tro, rơi vãi trên đường về.”\n… Bởi sự trong sáng của một tình cảm, bởi cái kết thúc buồn, rất buồn khi xuyên suốt câu chuyện vẫn là những điều vui, buồn lẫn lộn …  ', '255', '19000', '29'),
		('Tôi Là Ai – Và Nếu Vậy Thì Bao Nhiêu?', 'Richard David Precht', 'Tiểu thuyết', '2002-10-17', '25', 'data:image/webp;base64,', 'Tôi là ai ? Và nếu vậy thì bao nhiêu là hành tình đi tìm câu trả lời cho những câu hỏi triết học, trả lời câu hỏi tôi là ai, tôi là ai và đây là đâu, tôi là ai nếu vậy thì bao nhiêu, bạn là ai và chúng ta sống với mục đích gì…', '200', '15000', '54'),
        ('Naruto - Tập 1: Uzumaki Naruto', 'Masashi Kishimoto', 'Truyện', '2000-10-10', '128', 'data:image/jpeg;base64,', 'Chuyện xảy ra ở làng Lá với nhân vật chính là Naruto, học sinh trường đào tạo Ninja, chuyên đi quấy rối khắp làng!!\nNaruto có một ước mơ to lớn là đạt được danh hiệu Hokage - Một vị trí dành cho Ninja ưu tú nhất - Và vượt qua các Ninja tiền nhiệm.\nTuy nhiên, bí mật về thân thế của Naruto là…!?', '90', '39000', '90'
),
		('Naruto - Tập 6: Quyết tâm của Sakura', 'Masashi Kishimoto', 'Truyện', '2000-11-10', '243', 'data:image/jpeg;base64,', 'Vòng thứ 2 của kì thi tuyển Chunin đã bắt đầu!!\nNhóm Naruto bước vào cuộc chiến giành quyển trục trong khu rừng kì lạ. Tuy nhiên đằng sau đó, lai lịch bất minh của một số kẻ cũng dần được hé mở.\nKì thi tàn khốc có thể lấy đi sinh mạng của bất cứ thí sinh nào rồi sẽ ra sao…!?', '95', '39000', '59'
),
		('Tuổi trẻ đáng giá bao nhiêu?', 'Rosie Nguyễn', 'Self-help', '2018-07-28', '242', 'data:image/webp;base64,', '“Bạn hối tiếc vì không nắm bắt lấy một cơ hội nào đó, chẳng có ai phải mất ngủ.\nBạn trải qua những ngày tháng nhạt nhẽo với công việc bạn căm ghét, người ta chẳng hề bận lòng. Bạn có chết mòn nơi xó tường với những ước mơ dang dở, đó không phải là việc của họ. Suy cho cùng, quyết định là ở bạn. Muốn có điều gì hay không là tùy bạn.\nNên hãy làm những điều bạn thích. Hãy đi theo tiếng nói trái tim. Hãy sống theo cách bạn cho là mình nên sống. Vì sau tất cả, chẳng ai quan tâm.”\n“Tôi đã đọc quyển sách này một cách thích thú. Có nhiều kiến thức và kinh nghiệm hữu ích, những điều mới mẻ ngay cả với người gần trung niên như tôi. Tuổi trẻ đáng giá bao nhiêu? được tác giả chia làm 3 phần: HỌC, LÀM, ĐI. Nhưng tôi thấy cuốn sách còn thể hiện một phần thứ tư nữa, đó là ĐỌC. Hãy đọc sách, nếu bạn đọc sách một cách bền bỉ, sẽ đến lúc bạn bị thôi thúc không ngừng bởi ý muốn viết nên cuốn sách của riêng mình.\nNếu tôi còn ở tuổi đôi mươi, hẳn là tôi sẽ đọc Tuổi trẻ đáng giá bao nhiêu? nhiều hơn một lần.” - Đặng Nguyễn Đông Vy, tác giả, nhà báo.', '150', '33000', '25'
),
		('Những Tấm Lòng Cao Cả', 'Edmondo De Amicis', 'Tiểu thuyết', '1987-02-10', '90', 'data:image/jpeg;base64,', 'Cuốn sách Những Tấm Lòng Cao Cả chứa nội dung đơn giản là cuộc sống bình thường của một cậu bé, mà cũng thật là cảm động. Những tình cảm dung dị và ngây thơ cậu dành cho cô giáo lớp một, bố mẹ, cả bạn bè cùng lớp, trong cái cách mà cậu miêu tả về họ đầy hồn nhiên và yêu thương.', '130', '21000', '56'
),
		('Ông Già Và Biển Cả', 'Hemingway', 'Truyện', '1999-12-20', '140', 'data:image/jpeg;base64,', 'Ông già và Biển cả (The Old Man and the Sea) là truyện ngắn dạng viễn tưởng cuối cùng được viết bởi Hemingway. Trong tác phẩm này, ông đã triệt để sử dụng nguyên lý mà ông gọi là “tảng băng trôi”, chỉ mô tả một phần nổi còn lại bảy phần chìm, lúc mô tả sức mạnh của con cá, sự chênh lệch về lực lượng, về cuộc chiến đấu không cân sức giữa con cá hung dữ với ông già. Tác phẩm ca ngợi niềm tin, sức lao động và khát vọng của con người.', '210', '59000', '95'
),
		('Sự im lặng của bầy cừu', 'Thomas Harris ', 'Trinh thám', '1968-12-11', '140', 'data:image/webp;base64,', 'Những cuộc phỏng vấn ở xà lim với kẻ ăn thịt người ham thích trò đùa trí tuệ, những tiết lộ nửa chừng hắn chỉ dành cho kẻ nào thông minh, những cái nhìn xuyên thấu thân phận và suy tư của cô mà đôi khi cô muốn lảng trá Clarice Starling đã dấn thân vào cuộc điều tra án giết người lột da hàng loạt như thế, để rồi trong tiếng bức bối của chiếc đồng hồ đếm ngược về cái chết, cô phải vật lộn để chấm dứt tiếng kêu bao lâu nay vẫn đeo đẳng giấc mơ mình: tiếng kêu của bầy cừu sắp bị đem đi giết thịt.\nSự im lặng của bầy cừu hội tụ đầy đủ những yếu tố làm nên một cuốn tiểu thuyết trinh thám kinh dị xuất sắc nhất: không một dấu vết lúng túng trong những chi tiết thuộc lĩnh vực chuyên môn, với các tình tiết giật gân, cái chết luôn lơ lửng, với cuộc so găng của những bộ óc lớn mà không có chỗ cho kẻ ngu ngốc để cuộc chơi trí tuệ trở nên dễ dàng. Bồi đắp vào cốt truyện lôi cuốn đó là cơ hội được trải nghiệm trong trí não của cả kẻ gây tội lẫn kẻ thi hành công lý, khi mỗi bên phải vật vã trong ngục tù của đau đớn để tìm kiếm, khẩn thiết và liên tục, một sự lắng dịu cho tâm hồn.', '90', '61000', '45'
),
        ('Những cuộc phiêu lưu của Sherlock Holmes', 'Arthur Conan Doyle', 'Trinh thám', '1887-10-02', '490', 'data:image/jpeg;base64,', 'Sherlock Holmes là một nhân vật thám tử hư cấu, xuất hiện lần đầu trong tác phẩm của nhà văn Arthur Conan Doyle xuất bản năm 1887. Nhân vật là một thám tử tư ở London, nổi tiếng nhờ trí thông minh, khả năng suy diễn logic và quan sát tinh tường trong khi phá những vụ án mà cảnh sát phải bó tay.\nNhiều người cho rằng Sherlock Holmes là nhân vật thám tử hư cấu nổi tiếng nhất trong lịch sử văn học và là một trong những nhân vật văn học được biết đến nhiều nhất trên toàn thế giới.', '200', '55000', '61'
),
        ('Nhà giả kim', 'Paulo Coelho', 'Tiểu thuyết', '2002-10-10', '140', 'data:image/webp;base64,', 'Nội dung cuốn sách xoay quanh câu chuyện cậu bé chăn cừu Santiago và cuộc hành trình đi tìm kho báu của cậu. Cuộc hành trình đó đã dạy cho cậu rất nhiều bài học về cuộc sống. Thông qua đó giúp cho cậu nhận ra được mục đích và ý nghĩa của cuộc đời mình. Và thông quá câu chuyện đó chúng ta sẽ nhận ra rất nhiều chân lý và bài học quý giá về cuộc sống. ', '240', '59000', '46'
),
        ('Đừng Lựa Chọn An Nhàn Khi Còn Trẻ', 'Cảnh Thiên', 'Kỹ năng sống', '2021-02-18', '231', 'data:image/jpeg;base64,', 'Trong độ xuân xanh phơi phới ngày ấy, bạn không dám mạo hiểm, không dám nỗ lực để kiếm học bổng, không chịu tìm tòi những thử thách trong công việc, không phấn đấu hướng đến ước mơ của mình. Bạn mơ mộng rằng làm việc xong sẽ vào làm ở một công ty nổi tiếng, làm một thời gian sẽ thăng quan tiến chức. Mơ mộng rằng khởi nghiệp xong sẽ lập tức nhận được tiền đầu tư, cầm được tiền đầu tư là sẽ niêm yết trên sàn chứng khoán. Mơ mộng rằng muốn gì sẽ có đó, không thiếu tiền cũng chẳng thiếu tình, an hưởng những năm tháng êm đềm trong cuộc đời mình.\n\nNhưng vì sao bạn lại nghĩ rằng bạn chẳng cần bỏ ra chút công sức nào, cuộc sống sẽ dâng đến tận miệng những thứ bạn muốn? Bạn cần phải hiểu rằng: Hấp tấp muốn mau chóng thành công rất dễ khiến chúng ta đi vào mê lộ. Thanh xuân là khoảng thời gian đẹp đẽ nhất trong đời, cũng là những năm tháng then chốt có thể quyết định tương lai của một người. Nếu bạn lựa chọn an nhàn trong 10 năm, tương lai sẽ buộc bạn phải vất vả trong 50 năm để bù đắp lại. Nếu bạn bươn chải vất vả trong 10 năm, thứ mà bạn chắc chắn có được là 50 năm hạnh phúc. Điều quý giá nhất không phải là tiền mà là tiền bạc.\nThế nên, bạn à, đừng lựa chọn an nhàn khi còn trẻ.', '120', '29000', '88'
),
        ('One Piece - Tập 78: Sức Hút Của Tội Ác', 'Eiichiro Oda', 'Truyện tranh', '2023-05-03', '223', 'data:image/jpeg;base64,', 'Mang theo nguyện vọng của toàn thể người dân trong vương quốc Dressrosa, nhóm của Luffy đã bước vào trận chiến cuối cùng!! Khi trận đánh của mỗi người đi đến cao trào, cũng là lúc Luffy đối mặt với Doflamingo!! Báo hiệu một trận chiến cực hạn khó có thể tưởng tượng!! Những chuyến phiêu lưu trên đại dương xoay quanh \"ONE PIECE\" lại bắt đầu!!\n\nOne Piece (Vua hải tặc) bộ thuộc thể loại truyện tranh Hành động kể về một cậu bé tên Monkey D. Luffy, giong buồm ra khơi trên chuyến hành trình tìm kho báu huyền thoại One Piece và trở thành Vua hải tặc. Để làm được điều này, cậu phải đến được tận cùng của vùng biển nguy hiểm và chết chóc nhất thế giới: Grand Line (Đại Hải Trình). Luffy đội trên đầu chiếc mũ rơm như một nhân chứng lịch sử vì chiếc mũ rơm đó đã từng thuộc về hải tặc hùng mạnh: Hải tặc vương Gol. D. Roger và tứ hoàng Shank \"tóc đỏ\". Luffy lãnh đạo nhóm hải tặc Mũ Rơm qua East Blue (Biển Đông) và rồi tiến đến Grand Line. Cậu theo dấu chân của vị vua hải tặc quá cố, Gol. D. Roger, chu du từ đảo này sang đảo khác để đến với kho báu vĩ đại.', '90', '39000', '86'
),
		('Cho tôi xin 1 vé đi tuổi thơ', 'Nguyễn Nhật Ánh', 'Tiểu thuyết', '2011-05-03', '129', 'data:image/webp;base64,', 'Trong Cho tôi xin một vé đi tuổi thơ, nhà văn Nguyễn Nhật Ánh mời người đọc lên chuyến tàu quay ngược trở lại thăm tuổi thơ và tình bạn dễ thương của 4 bạn nhỏ. Những trò chơi dễ thương thời bé, tính cách thật thà, thẳng thắn một cách thông minh và dại dột, những ước mơ tự do trong lòng… khiến cuốn sách có thể làm các bậc phụ huynh lo lắng rồi thở phào. Không chỉ thích hợp với người đọc trẻ, cuốn sách còn có thể hấp dẫn và thực sự có ích cho người lớn trong quan hệ với con mình.', '234', '49000', '65'
),
		('Kĩ Thuật Giải Nhanh Bài Toán Hay & Khó Hình Học 11', 'ThS. Nguyễn Duy Hiếu', 'Sách tham khảo', '2021-04-01', '112', 'data:image/webp;base64,', 'Cuốn sách gồm ba chương:\nChương 1: PHÉP DỜI HÌNH VÀ PHÉP ĐỒNG DẠNG TRONG MẶT PHẲNG.\nChương 2: ĐƯỜNG THẲNG VÀ MẶT PHẲNG TRONG KHÔNG GIAN - QUAN HỆ SONG SONG.\nChương 3: VECTƠ TRONG KHÔNG GIAN QUAN HỆ VUÔNG GÓC.\nNội dung của mỗi chương được trình bày theo bố cục bài học như Sách giáo khoa .', '200', '39000', '85'
),
		('Đắc nhân tâm', 'Dale Carnegie', 'Tiểu thuyết', '2012-05-16', '160', 'data:image/jpeg;base64,', 'Nội dung của cuốn sách đắc nhân tâm chủ yếu hướng đến nghệ thuật ứng xử cơ bản trong giao tiếp hàng ngày, cách tạo thiện cảm tìm kiếm sự yêu mến chân thật của người đối diện. Và hướng đến giá trị cốt lõi chính là “hiểu mình, hiểu người” và từ đó tạo ra một cuộc sống tốt đẹp, nhẹ nhàng.', '250', '59000', '80'
);

