CREATE TABLE `railway`.`orders` (
  `orderid` INT NOT NULL,
  `userid` INT NOT NULL,
  `bookid` INT NOT NULL,
  `title` TINYTEXT NOT NULL,
  `quantity` INT NOT NULL,
  `price` INT NOT NULL,
  `total` TINYTEXT NOT NULL,
  `date` DATE NOT NULL,
  PRIMARY KEY (`orderid`));

        